import React from "react"
import { DataGrid } from "@material-ui/data-grid";

function Table() {
  const columns = [
    { field: 'countryName', headerName: 'ID', width: 50 },
    { field: 'firstName', headerName: 'First name', width: 70 },
    { field: 'lastName', headerName: 'Last name', width: 70 },
  ];

  const rows = [
    { countryName: 1, lastName: 'Snow', firstName: 'Jon'},
    { countryName: 2, lastName: 'Lannister', firstName: 'Cersei'},
    { countryName: 3, lastName: 'Lannister', firstName: 'Jaime'},
    { countryName: 4, lastName: 'Stark', firstName: 'Arya'},
    { countryName: 5, lastName: 'Targaryen', firstName: 'Daenerys'},
    { countryName: 6, lastName: 'Melisandre', firstName: null},
    { countryName: 7, lastName: 'Clifford', firstName: 'Ferrara'},
    { countryName: 8, lastName: 'Frances', firstName: 'Rossini'},
    { countryName: 9, lastName: 'Roxie', firstName: 'Harvey'},
  ];


  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div>
  )
}

export default Table
